import React from "react";
import StockChart from "../components/StockChart";
import StockCard from "../components/StockCard";
import PredictionCard from "../components/PredictionCard";
import sampleData from "../data/sampleData";

const Dashboard = () => {
  return (
    <div className="dashboard">
      <h1>ðŸ“Š Market Dashboard</h1>
      <div className="cards-row">
        <StockCard title="Nifty 50" value="19,750" change={1.5} />
        <StockCard title="Sensex" value="66,300" change={-0.8} />
        <StockCard title="Bank Nifty" value="43,250" change={0.7} />
      </div>

      <StockChart data={sampleData} />

      <div className="prediction-row">
        <PredictionCard stock="TCS" prediction="Buy" />
        <PredictionCard stock="Infosys" prediction="Sell" />
        <PredictionCard stock="Reliance" prediction="Buy" />
      </div>
    </div>
  );
};

export default Dashboard;
